import React, { useState, useEffect } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import axios from 'axios';
import L from 'leaflet';

// Custom blue dot icon
const blueDotIcon = new L.DivIcon({
  html: '<div style="width: 16px; height: 16px; background: rgba(0,123,255,0.7); border-radius: 50%; box-shadow: 0 0 12px rgba(0,123,255,0.5);"></div>',
  className: ''
});

// Green marker icon
const greenIcon = new L.Icon({
  iconUrl: 'https://raw.githubusercontent.com/pointhi/leaflet-color-markers/master/img/marker-icon-green.png',
  shadowUrl: 'https://unpkg.com/leaflet@1.7.1/dist/images/marker-shadow.png',
  iconSize: [25, 41],
  iconAnchor: [12, 41],
  popupAnchor: [1, -34],
  shadowSize: [41, 41]
});

const MapComponent = () => {
  const [locations, setLocations] = useState([]);
  const [userLocation, setUserLocation] = useState(null);
  const [nearest, setNearest] = useState(null);

  // Fetch locations + user location
  useEffect(() => {
    axios.get('http://localhost:5000/api/locations')
      .then((res) => setLocations(res.data));

    navigator.geolocation.getCurrentPosition((pos) => {
      const userLat = pos.coords.latitude;
      const userLng = pos.coords.longitude;
      setUserLocation({ lat: userLat, lng: userLng });

      // Send to backend to update travel times
      fetch('http://localhost:5000/update-travel-times', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ userLat, userLng }),
      })
        .then((res) => res.json())
        .then((data) => console.log('Travel times updated', data))
        .catch((err) => console.error('Error updating travel times:', err));
    });
  }, []);

  // Haversine formula
  const getDistance = (lat1, lon1, lat2, lon2) => {
    const R = 6371;
    const dLat = (lat2 - lat1) * Math.PI / 180;
    const dLon = (lon2 - lon1) * Math.PI / 180;
    const a =
      Math.sin(dLat / 2) ** 2 +
      Math.cos(lat1 * Math.PI / 180) *
      Math.cos(lat2 * Math.PI / 180) *
      Math.sin(dLon / 2) ** 2;
    const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
    return R * c;
  };

  // Find nearest location
  const findNearest = () => {
    if (!userLocation || locations.length === 0) return;

    let nearestLoc = null;
    let minDistance = Infinity;

    locations.forEach((loc) => {
      const dist = getDistance(userLocation.lat, userLocation.lng, loc.latitude, loc.longitude);
      if (dist < minDistance) {
        minDistance = dist;
        nearestLoc = loc;
      }
    });

    setNearest(nearestLoc);
    alert(`Nearest Location: ${nearestLoc.name} (${minDistance.toFixed(2)} km)`);
  };

  return (
    <>
      <button
        onClick={findNearest}
        style={{ margin: '10px', padding: '8px 14px', fontSize: '14px', cursor: 'pointer' }}
      >
        üîç Find Nearest
      </button>

      <MapContainer
        center={[20.5937, 78.9629]}
        zoom={5}
        style={{ height: "600px", width: "100%", maxWidth: "800px", margin: "0 auto", borderRadius: "10px" }}
      >
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />

        {locations.map((loc) => (
          <Marker
            key={loc._id}
            position={[loc.latitude, loc.longitude]}
            icon={greenIcon}
          >
            <Popup>
              <strong>{loc.name}</strong><br />
              Distance: {loc.distance ? `${loc.distance.toFixed(2)} km` : 'Unknown'}<br />
              Time: {loc.travelTime || 'Unknown'}<br />
              <form method="GET" action={`http://localhost:5000/${loc._id}`}>
                <button type="submit">View Details</button>
              </form>
            </Popup>
          </Marker>
        ))}

        {userLocation && (
          <Marker position={[userLocation.lat, userLocation.lng]} icon={blueDotIcon}>
            <Popup>Your Location</Popup>
          </Marker>
        )}

        {nearest && (
          <Marker position={[nearest.latitude, nearest.longitude]}>
            <Popup>üö© Nearest: {nearest.name}</Popup>
          </Marker>
        )}
      </MapContainer>
    </>
  );
};

export default MapComponent;
